import React from 'react';

import pnglogo from '../../assets/img/portal-tech.png';
import styles from './Logo.module.css';

const logo = (props) => {
    return (
        <div className={styles.Logo} style={{height: props.height}}>
            <img src={pnglogo} alt='mylogo'/>
        </div>
    )
};

export default logo;
